import React from 'react';
import "./FormComponents.css"

export const Input = ({
    type,
    id,
    value,
    required,
    addClass,
    name,
    placeholder,
    onChange
}) => {


    return (

        <input type={type}
        id={id}
        name={name}
        value={value}
        required={required ? "required" : ""}
        placeholder={placeholder}
        onChange={onChange}
        className={` input-component  ${addClass}`}
        autoComplete="off"
        />
    )
};

export const Label = ({
htmlfor, 
labeltext
}) => { 
return (

<label 
htmlFor={htmlfor}
>
    {labeltext}

</label>

)};

export const Button = ({
    id,
    name,
    textButton,
    type,
    manipulationFunction,
    addClass
}) => {
return(

<button
id={id}
name={name}
type={type}
onClick={manipulationFunction}
className={`button-component ${addClass}`}
>
{textButton}

</button>

)}
